/*
 * Default navigation controls
 * by Peter Murawski
 *******************************
 * Injects necessary markup to document body with Javascript
 * Adds listeners to document body for nav events:
 * 	- navOn: Show nav controls if hidden
 *  - navOff: Hide nav controls if visible
 * Requires jQuery and jQuery UI
 * Also requires nav.css for default styles
 */

Monsoon.Nav = {
	enabled: true,
	progressBar: undefined,
	pageSelector: undefined,
	currentPageIndex: 0,
	maxPageIndex: undefined,
	redirect: {},

        init: function() {
        	var isIE = /*@cc_on!@*/!1; // Detect IE using conditional compilation

            var visiblenum = 0;
			$(Monsoon.page_indexes).each(function(p, page) {
               	var pagenum = parseInt(p)+1;
                var $page = $('#'+page);
				var pagetitle = $page.data('title') || 'No Title';
                if($page.hasClass('navhidden') || $page.hasClass('navskip'))
					return;
				visiblenum++;
                Monsoon.Nav.maxPageIndex = parseInt(p);
			});

            Monsoon.Nav.fillPageSelector($(Monsoon.page_indexes));

            Monsoon.Nav.refresh();
			Monsoon.onPageReady(function() {Monsoon.Nav.refresh()});
			Monsoon.onPageExit(function(e, page) { $(page).data('completed', true); });

			if(!Monsoon.Nav.enabled) {
				Monsoon.Nav.enabled = true;
				$(document).trigger("navOff");
			}

            $(document).keyup(function(e) {
	            if (Monsoon.keyboardEnabled) {
		            switch(e.keyCode) {
		                case 37:
		                    Monsoon.Nav.prev();
		                    break;
		                case 39:
		                    Monsoon.Nav.next();
		                    break;
		                default:
		                    break;
		            }
				}
            });
        },

	prev: function() {
		if (Monsoon.Nav.currentPageIndex > 0) {
        	Monsoon.previousPage();
        	Monsoon.Nav.refresh();
   		}
	},
	next: function() {
		var id = Monsoon.getPageId();
		if (Monsoon.Nav.redirect[id]) {
			Monsoon.Nav.to(Monsoon.Nav.redirect[id]);
		} else if (Monsoon.Nav.currentPageIndex < Monsoon.Nav.maxPageIndex) {
    		Monsoon.nextPage();
    		Monsoon.Nav.refresh();
    	}
	},
	to: function(id) {
		Monsoon.changePage(id);
		Monsoon.Nav.refresh();
	},
	on: function() {
		$(document).trigger('navOn');
	},
	off: function() {
		$(document).trigger('navOff');
	},
	toggle: function() {
		if (this.enabled) {
			this.off();
		} else {
			this.on();
		}
	},
    getProgressPercent: function() {
        //2.0 updated

		var weighted = Monsoon.pages.toArray()
			.map(function(page) {
				return $(page);
			})
			.filter(function($page) {
				return parseFloat($page.attr('data-weight')) !== 0;
			});

		var completed = weighted.reduce(function(a, $page) {
				return a + Number($page.data('completed'));
			}, 0);

		return weighted ? Math.round(100 * completed / weighted.length) : 100;

       /*
        var currentPage = this.currentPageIndex;

        var totalWeight          = 0;
        var totalWeightCompleted = 0;

        $(Monsoon.page_indexes).each(function(p, page) {
            var $page = $('#'+page);

            if($page.hasClass('navhidden') || $page.hasClass('navskip')) {
                return;
            }

            var weight = 1;
            if ($page.data('weight') != null) {
                weight = $page.data('weight');
            }

            totalWeight += weight;

            //only if p is less than currentPage
            //because the currentPage doesn't count as completed
            if (p < currentPage) {
                totalWeightCompleted += weight;
            }
        });

        var percentComplete = 0;
        if (totalWeight > 0) {
            percentComplete = Math.round((totalWeightCompleted / totalWeight) * 100);
        }

        return percentComplete;*/
    },
	updateProgressBar: function() {
        //2.0 updated

        // Update progress bar text with current percentage
        var percentComplete = this.getProgressPercent();

        $('.js-template-progress-bar').html('');
        $('.js-template-progress-bar-text').html(percentComplete + '% Completed');
        $('.js-template-progress-bar-text-short').html(percentComplete + '%');

        $('.js-template-progress-bar').css('width', percentComplete+'%').attr('aria-valuenow', percentComplete);
	},

    fillPageSelector: function($pageIndexes) {
        //clear the items then add them back in
        $('.js-navigation-list').html('');

        $(Monsoon.page_indexes).each(function(p, page) {
            var pagenum = parseInt(p)+1;
            var $page = $('#'+page);

            if($page.hasClass('navhidden') || $page.hasClass('navskip'))
                return;

            var pageTitle = $page.data('title') || 'No Title';

            pageTitle = pagenum + ':' + pageTitle;

            var $pageLink = $('<div></div>');

            $pageLink.addClass('js-page-menu-item');
            $pageLink.addClass('template__menu-item');
            $pageLink.attr('data-page-index', Monsoon.page_indexes.indexOf(page));
            $pageLink.attr('data-title', page);
            $pageLink.html(pageTitle);

            $('.js-navigation-list').append($pageLink);
        });
    },

	updatePageSelector: function() {
		Monsoon.Nav.fillPageSelector($(Monsoon.page_indexes));
	},
	updateNavButtons: function() {
        //2.0 updated
        //
		//No longer hiding / showing via jquery
        //This will allow us to define animations via css
        if (!this.enabled) {
            $('.js-template-prev').addClass('nav-disabled');
            $('.js-template-next').addClass('nav-disabled');
        } else if (this.currentPageIndex == 0) {
            $('.js-template-prev').addClass('nav-disabled');
            $('.js-template-next').removeClass('nav-disabled');
        } else if ((this.currentPageIndex + 1) == Monsoon.page_indexes.length) {
            $('.js-template-prev').removeClass('nav-disabled');
            $('.js-template-next').addClass('nav-disabled');
        } else {
            $('.js-template-prev').removeClass('nav-disabled');
            $('.js-template-next').removeClass('nav-disabled');
        }
	},
	refresh: function() {
		// Refresh state of navigation UI elements.
		this.currentPageIndex = Monsoon.index;//$.inArray(Monsoon.current.getAttribute("id"), Monsoon.page_indexes);

		this.updateNavButtons();
		this.updateProgressBar();
		this.updatePageSelector();
	}
};

